import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
  Legend,
} from "recharts";
import { universities } from "./UniversityData";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(null);
  const [selectedSubjectName, setSelectedSubjectName] = useState("");
  const [selectedStudentType, setSelectedStudentType] = useState("International");

  const handleUniversityChange = (event) => {
    const uni = universities.find((u) => u.name === event.target.value);
    setSelectedUniversity(uni);
    setSelectedSubjectName("");
  };

  const handleSubjectChange = (event) => {
    setSelectedSubjectName(event.target.value);
  };

  const handleStudentTypeChange = (type) => {
    setSelectedStudentType(type);
  };

  const selectedSubject =
    selectedUniversity?.subjects.find((s) => s.name === selectedSubjectName);

  const chartData =
    selectedSubject?.rankings.map((r) => ({
      year: r.year,
      rank: r.rank,
    })) || [];

  return (
    <div className="p-4 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold mb-4 text-center">
        QS World University Rankings Explorer
      </h1>

      {/* University Dropdown */}
      <div className="mb-4">
        <label className="font-semibold">Select University: </label>
        <select
          className="border p-2 rounded ml-2"
          onChange={handleUniversityChange}
          value={selectedUniversity?.name || ""}
        >
          <option value="">-- Select --</option>
          {universities.map((u) => (
            <option key={u.name} value={u.name}>
              {u.name}
            </option>
          ))}
        </select>
      </div>

      {/* Student Type Toggle */}
      {selectedUniversity && (
        <div className="mb-4">
          <button
            className={`px-4 py-2 rounded-l ${
              selectedStudentType === "International"
                ? "bg-blue-500 text-white"
                : "bg-gray-200"
            }`}
            onClick={() => handleStudentTypeChange("International")}
          >
            International
          </button>
          <button
            className={`px-4 py-2 rounded-r ${
              selectedStudentType === "Domestic"
                ? "bg-blue-500 text-white"
                : "bg-gray-200"
            }`}
            onClick={() => handleStudentTypeChange("Domestic")}
          >
            Domestic
          </button>
        </div>
      )}

      {/* General QS Rank */}
      {selectedUniversity && (
        <div className="mb-4 text-lg font-medium">
          General QS Rank:{" "}
          <span className="font-bold">{selectedUniversity.generalQSRank}</span>
        </div>
      )}

      {/* Subject Dropdown */}
      {selectedUniversity && (
        <div className="mb-4">
          <label className="font-semibold">Subjects Offered: </label>
          <select
            className="border p-2 rounded ml-2"
            onChange={handleSubjectChange}
            value={selectedSubjectName}
          >
            <option value="">-- Select Subject --</option>
            {selectedUniversity.subjects.map((s) => (
              <option key={s.name} value={s.name}>
                {s.name}
              </option>
            ))}
          </select>
        </div>
      )}

      {/* Subject Details */}
      {selectedSubject && (
        <>
          <div className="mb-4">
            <p className="text-lg font-semibold">{selectedSubject.name}</p>
            <p className="text-sm text-gray-600">
              Eligibility ({selectedStudentType}):{" "}
              {selectedSubject.eligibility[selectedStudentType] || "N/A"}
            </p>
            <p className="text-sm text-gray-600">
              Tuition Fees: {selectedSubject.fees[selectedStudentType] || "N/A"}
            </p>
            <p className="text-sm text-gray-600">
              Intake Dates: {selectedSubject.intake || "N/A"}
            </p>
            <p className="text-sm text-gray-600">
              Application Deadline: {selectedSubject.deadline || "N/A"}
            </p>
          </div>

          {/* Line Chart */}
          <h3 className="text-xl font-semibold mb-2">QS Subject Rankings (Past Years)</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={chartData}>
              <XAxis dataKey="year" />
              <YAxis allowDecimals={false} domain={["auto", "auto"]} />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="rank" stroke="#1f77b4" strokeWidth={3} dot={{ r: 5 }} />
            </LineChart>
          </ResponsiveContainer>

          {/* Ranking Table */}
          <div className="overflow-x-auto mt-6">
            <h3 className="text-xl font-semibold mb-2">Subject Details Table</h3>
            <table className="min-w-full border border-gray-300 text-sm text-left">
              <thead className="bg-gray-200">
                <tr>
                  <th className="p-2 border">Year</th>
                  <th className="p-2 border">QS Rank</th>
                  <th className="p-2 border">SAT Cutoff</th>
                  <th className="p-2 border">GPA Cutoff</th>
                </tr>
              </thead>
              <tbody>
                {selectedSubject.rankings.map((r) => (
                  <tr key={r.year} className="hover:bg-gray-50">
                    <td className="p-2 border">{r.year}</td>
                    <td className="p-2 border">{r.rank}</td>
                    <td className="p-2 border">
                      {selectedSubject.eligibility[selectedStudentType]?.match(/SAT\s(\d+)/)?.[1] || "—"}
                    </td>
                    <td className="p-2 border">
                      {selectedSubject.eligibility[selectedStudentType]?.match(/GPA\s(?:above\s)?([\d.]+)/i)?.[1] || "—"}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </>
      )}
    </div>
  );
}

export default App;
